window.bookSummaryJSON = "<p><b>The second book in the bestselling Female series by Invi Wright, where a woman born into a life where her fate was already decided for her, now finds a way to fight back, with the most unlikely of allies...</b></p> <p>Living with three powerful demons is not easy, especially when they’re dead set on making you theirs.</p> <p>Charlotte’s life was decided for her the moment she was born, but now she’s faced with the opportunity to change the fate of millions of purchased females—and the generations to follow. Her males have agreed to fight to free her kind, righting the mistake they made so many years ago.</p> <p>Thrust into a world of politics and nuances too subtle to understand, Charlotte quickly learns the truth is never what it seems. Lies and deceit pull her in different directions, and she soon begins questioning who she can trust.</p> <p>Charlotte finds herself navigating alliances and broken promises with the strongest rulers of the realms, all while discovering who she is beyond just a purchased female.</p>"; 
